import React from 'react';
import { Dropdown, Menu } from 'semantic-ui-react'

class Home extends React.Component {
    render() {
        return (
            <Menu compact>
                <Dropdown text='Dropdown' options={options} simple item />
            </Menu>
        );
    }
}

export default Home;
